        indicatorColor="primary"
        textColor="primary"
        onChange={handleChange}
        variant="fullWidth"
        aria-label="disabled tabs example"
      >
        <Tab label="All" />
        <Tab label="Bakery"/>
        <Tab label="Entrees" />
        <Tab label="Drinks" />
      </Tabs>
    </div>
  );
}

export default App;
